import styled from 'styled-components';
export const StyledContainer = styled.div`
    width: 100vw;
    margin-top: 3vw;
    display: flex;
    flex-direction: column;
    align-items: center;`

export const StyledLoginMensagem= styled.p`
    text-transform: uppercase;
    font-size: 1.5vw;
    color: #44281d;
    font-family: 'Kanit', sans-serif;
    font-weight: 800;
    margin: 1.5vw 0vw;
`;
